import Comment from "./Comment";


const CommentsSection = ({comments}) => {
    console.log(comments)
    return(
            <div>
                Comment Section:
                <div>
                    {comments.map( comment => <Comment  description={comment.description}/> )}
                </div>
            </div>
    )
}
export default CommentsSection
